const NovoItem = ({ content }) => {
  return (
    <section style={{
      display: 'flex',
       flexDirection: 'row',
        gap: '1rem',
         border: '1px solid',
          width: 'fit-content',
           padding: '1rem',
            marginBottom: '1rem'}}>
      <p style={{ display: 'inline'}}>{content}</p>
      <button >{'excluir'}</button>
    </section>
  );
};

export default NovoItem;
